config.script:
selectedRowData = self.parent.parent.parent.getChild("Row2/WorkOrders").props.selection.data
modalName = "scheduleWO"
modalPath = "App/Schedule/ScheduleManagement/Embedded/Popups/ScheduleWO"

params = {
	"ModalName": modalName,
	"RowData": selectedRowData
}

errorParams = {
	"ModalName": "ErrorModal",
	"ErrorMessage": "Please select a row first!"
}

if len(selectedRowData) > 0:
	system.perspective.openPopup(modalName, modalPath, params, title="Schedule Work Order", modal=True, overlayDismiss=True)
else:
	system.perspective.openPopup("ErrorModal", "GlobalComponents/Modals/ErrorModal", errorParams)

